pragma solidity ^0.6.6;

import "./UniswapV2Library.sol";
import "./interfaces/IUniswapV2Router02.sol";
import "./interfaces/IUniswapV2Pair.sol";
import "./interfaces/IUniswapV2Factory.sol";
import "./interfaces/IERC20.sol";

contract Arbitrage {
    address public factory;
    uint256 constant deadline = 1 days;
    IUniswapV2Router02 public exchangeRouter;
    event log(uint16 algo);
    event log2(address add);
    event log3(address msgSender);

    constructor() public {
        factory = 0x6725F303b657a9451d8BA641348b6761A6CC7a17; //factory de pancakeswap
        exchangeRouter = IUniswapV2Router02(
            0x3bc677674df90A9e5D741f28f6CA303357D0E4Ec
        ); //router de hyperswap
    }

    function startArbitrage(
        address token0, //wbnb
        address token1, //token x
        uint256 amount0,
        uint256 amount1
    ) external {
        emit log(1);
        // se obtiene el pair address de (wbnb/token x) del factory al cual le pedire prestado
        address pairAddress =
            IUniswapV2Factory(factory).getPair(token0, token1);
        require(pairAddress != address(0), "This pool does not exist");
        emit log2(pairAddress);
        // pido prestado al factory
        IUniswapV2Pair(pairAddress).swap(
            amount0,
            amount1,
            address(this),
            bytes("not empty")
        );
    }

    function pancakeCall(
        address _sender,
        uint256 _amount0,
        uint256 _amount1,
        bytes calldata _data
    ) external {
        emit log(2);
        //[wbnb, token x]
        address[] memory path = new address[](2);
        uint256 amountToken = _amount0 == 0 ? _amount1 : _amount0;

        address token0 = IUniswapV2Pair(msg.sender).token0();
        address token1 = IUniswapV2Pair(msg.sender).token1();

        emit log3(msg.sender);
        emit log3(address(this));

        require(
            //msg.sender == UniswapV2Library.pairFor(factory, token0, token1),
            msg.sender == IUniswapV2Factory(factory).getPair(token0, token1),
            "Unauthorized"
        );
        require(_amount0 == 0 || _amount1 == 0);

        path[0] = _amount0 == 0 ? token1 : token0;
        path[1] = _amount0 == 0 ? token0 : token1;

        IERC20 token = IERC20(_amount0 == 0 ? token1 : token0);

        //approve de wbnb para que el router gaste
        token.approve(address(exchangeRouter), amountToken);

        emit log(3);
        //obtengo el precio del wbnb en token x consultando al factory
        uint256 amountRequired =
            UniswapV2Library.getAmountsIn(factory, amountToken, path)[0];

        //cambio los wbnb por token x en el router y se guarda en el address del contrato
        uint256 amountReceived =
            exchangeRouter.swapExactETHForTokens{value: amountToken}(
                amountRequired,
                path,
                address(this), //msg.sender,
                deadline
            )[1];

        emit log(4);
        IERC20 otherToken = IERC20(_amount0 == 0 ? token0 : token1);

        //se paga lo prestado al factory
        otherToken.transfer(msg.sender, amountRequired);

        //se me da el profit
        otherToken.transfer(
            0x97c14E4e7ECEc5106b315ed4c7cA1983AfFc11b3,
            amountReceived - amountRequired
        );
        emit log(5);
    }
}
